import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    menuButton: {
        borderColor: "#000000",
        borderWidth: 2,
        borderRadius: 26,
        backgroundColor: '#F3E05E',
        flexDirection: "row",
        justifyContent: "flex-start",
        marginTop: 20,
        padding: 5
    },
    menuButton_icon:{
        width: 90,
        height: 90,
        borderWidth: 3,
        borderColor: "#000000", 
        borderRadius: 45
    },
    menuButton_text:{
        width: 250,
        color: '#FFFFFF',
        fontSize: 46,
        position: "relative",
        top: +12,
    }
});

export default styles
